import React from "react";
import Box from '@mui/material/Box';
import Logo from './imagenes/Logo.png';
import lupa from './imagenes/lupa.png';
import viajeros from './imagenes/viajeros.png';
import maleta from './imagenes/maleta.png';
import { Input } from 'semantic-ui-react'


function Navbar (){
  return (
    <Box className="nav" style={{ background:'#9ACD32', height:'' }}>
      <nav className="navbar" style={{ display:'flex', justifyContent:'space-evenly', alignItems:'center'  }}>
        <Box>
          <img
            className="logo"
            style={{ height: "6em" }}
            src={Logo}
            alt="Logo"
          />
        </Box>


const InputExampleIcon = () => <Input icon='search' placeholder='Search...' />

export default InputExampleIcon
        <input type='search' placeholder="Busca una actividad, un lugar,...." width='' />
        >
        <Box>
          <img
            className="viajeros"
            style={{ height: "2em" }}
            src={viajeros}
            alt="viajeros"
          />
        </Box>
        <Box>
          <img
            className="maleta"
            style={{ height: "2em" }}
            src={maleta}
            alt="maleta"
          />
        </Box>
      </nav>
    </Box>
  );
}
export default Navbar;
